  false,\n\t\"url\": null,\n\t\"notes\": \" The TIGER/Line shapefiles include both
  incorporated places (legal entities) and censusn               designated places
  or CDPs (statistical entities). An incorporated place is established to provide
  governmental functions for a concentration of peoplen               as opposed to
  a minor civil division (MCD), which generally is created to provide services or
  administer an area without regard, necessarily, ton               population. Places
  always nest within a state, but may extend across county and county subdivision
  boundaries. An incorporated place usually is a city,n               town, village,
  or borough, but can have other legal descriptions. CDPs are delineated for the decennial
  census as the statistical counterparts ofn               incorporated places. CDPs
  are delineated to provide data for settled concentrations of population that are
  identifiable by name, but aren               not legally incorporated under the
  laws of the state in which they are located. The boundaries for CDPs often are defined
  in partnership with state,n               local, and/or tribal officials and usually
  coincide with visible features or the boundary of an adjacent incorporated place
  or another legal entity. CDPn               boundaries often change from one decennial
  census to the next with changes in the settlement pattern and development; a CDP
  with the same name as in ann               earlier census does not necessarily have
  the same boundary. The only population/housing size requirement for CDPs is that
  they must contain some housingn               and population. The boundaries of
  most incorporated places in this shapefile are as of January 1, 2013, as reported
  through the Census Bureau'sn               Boundary and Annexation Survey (BAS).
  Limited updates that occurred after January 1, 2013, such as newly incorporated
  places, are also included. Then               boundaries of all CDPs were delineated
  as part of the Census Bureau's Participant Statistical Areas Program (PSAP) for
  the 2010 Census.n            \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
